Per weeki wachee, &quot;Shake It Off&quot; is a song by American recording artist Taylor Swift for her upcoming fifth studio album, 1989. Written by Swift, Max Martin and Shellback, the single, a departure from her signature country pop musical style, is an uptempo pop track instrumented by trombone. 

&quot;Shake It Off&quot; debuted at number one on the Billboard Hot 100 chart for the week ending September 6, 2014, becoming Swift's second number one single in the United States and the 22nd song to debut at number one in the chart's history.


